public class ResourceHolder 
{
  private FileStream fs; // Noncompliant; Dispose or Close are never called

  public void OpenResource(string path)
  {
    this.fs = new FileStream(path, FileMode.Open);
  }

  public void WriteToFile(string path, string text)
  {
    var fs = new FileStream(path, FileMode.Open); // Noncompliant
    var bytes = Encoding.UTF8.GetBytes(text);
    fs.Write(bytes, 0, bytes.Length);
  }
}

', 'role_origin_id': 'rule_RSPEC-2930', 'role_have_compliant_code': 'Y', 'role_level': 'BLOCKER', 'role_type': 'Bug', 'role_title': '\xe2\x80\x9cIDisposables\xe2\x80\x9d\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe5\xa4\x84\xe7\x90\x86.', 'role_desc_en': "When writing managed code, you don't need to worry about allocating or freeing memory: The garbage collector takes care of it. For efficiency reasons, some objects such as Bitmap use unmanaged memory, enabling for example the use of pointer arithmetic. Such objects have potentially huge unmanaged memory footprints, but will have tiny managed ones. Unfortunately, the garbage collector only sees the tiny managed footprint, and fails to reclaim the unmanaged memory (by calling Bitmap's finalizer method) in a timely fashion. Moreover, memory is not the only system resource which needs to be managed in a timely fashion: The operating system can only handle having so many file descriptors (e.g. FileStream) or sockets (e.g. WebClient) open at any given time. Therefore, it is important to Dispose of them as soon as they are no longer needed, rather than relying on the garbage collector to call these objects' finalizers at some nondeterministic point in the future.This rule tracks private fields and local variables of the following IDisposable types, which are never disposed, closed, aliased, returned, or passed to other methods.which are either instantiated directly using the new operator, or using one of the following factory methods:on both private fields and local variables.", 'role_id': 'S2930', 'role_desc': '\xe7\xbc\x96\xe5\x86\x99\xe6\x89\x98\xe7\xae\xa1\xe4\xbb\xa3\xe7\xa0\x81\xe6\x97\xb6\xef\xbc\x8c\xe6\x82\xa8\xe4\xb8\x8d\xe5\xbf\x85\xe6\x8b\x85\xe5\xbf\x83\xe5\x88\x86\xe9\x85\x8d\xe6\x88\x96\xe9\x87\x8a\xe6\x94\xbe\xe5\x86\x85\xe5\xad\x98\xef\xbc\x9a\xe5\x9e\x83\xe5\x9c\xbe\xe5\x9b\x9e\xe6\x94\xb6\xe5\x99\xa8\xe8\xb4\x9f\xe8\xb4\xa3\xe5\xa4\x84\xe7\x90\x86.\xe5\x87\xba\xe4\xba\x8e\xe6\x95\x88\xe7\x8e\x87\xe7\x9a\x84\x