', 'role_origin_id': 'rule_RSPEC-3869', 'role_have_compliant_code': '', 'role_level': 'BLOCKER', 'role_type': 'Bug', 'role_title': '\xe2\x80\x9c\xe7\x9a\x84SafeHandle.DangerousGetHandle\xe2\x80\x9c\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe8\xb0\x83\xe7\x94\xa8.', 'role_desc_en': "Not surprisingly, the SafeHandle.DangerousGetHandle method is dangerous. That's because it may not return a valid handle. Using it can lead to leaks and vulnerabilities. While it is possible to use the method successfully, it's extremely difficult to do correctly, so the method should simply be avoided altogether.", 'role_id': 'S3869', 'role_desc': '\xe4\xb8\x8d\xe5\xa5\x87\xe6\x80\xaa\xe7\x9a\x84\xe6\x98\xaf\xef\xbc\x8cSafeHandle.DangerousGetHandle\xe6\x96\xb9\xe6\xb3\x95\xe6\x98\xaf\xe5\x8d\xb1\xe9\x99\xa9\xe7\x9a\x84.\xe8\xbf\x99\xe6\x98\xaf\xe5\x9b\xa0\xe4\xb8\xba\xe5\xae\x83\xe5\x8f\xaf\xe8\x83\xbd\xe4\xb8\x8d\xe4\xbc\x9a\xe8\xbf\x94\xe5\x9b\x9e\xe6\x9c\x89\xe6\x95\x88\xe7\x9a\x84\xe5\x8f\xa5\xe6\x9f\x84.\xe4\xbd\xbf\xe7\x94\xa8\xe5\xae\x83\xe5\x8f\xaf\xe8\x83\xbd\xe4\xbc\x9a\xe5\xaf\xbc\xe8\x87\xb4\xe6\xb3\x84\xe6\xbc\x8f\xe5\x92\x8c\xe6\xbc\x8f\xe6\xb4\x9e.\xe8\x99\xbd\xe7\x84\xb6\xe5\x8f\xaf\xe4\xbb\xa5\xe6\x88\x90\xe5\x8a\x9f\xe4\xbd\xbf\xe7\x94\xa8\xe8\xaf\xa5\xe6\x96\xb9\xe6\xb3\x95\xef\xbc\x8c\xe4\xbd\x86\xe6\x98\xaf\xe5\xbe\x88\xe9\x9a\xbe\xe6\xad\xa3\xe7\xa1\xae\xe6\x89\xa7\xe8\xa1\x8c\xef\xbc\x8c\xe6\x89\x80\xe4\xbb\xa5\xe8\xaf\xa5\xe6\x96\xb9\xe6\xb3\x95\xe5\xba\x94\xe8\xaf\xa5\xe5\xae\x8c\xe5\x85\xa8\xe9\x81\xbf\xe5\x85\x8d.', 'role_title_en': '"SafeHandle.DangerousGetHandle" should not be called'}

