', 'role_origin_id': 'rule_RSPEC-2306', 'role_have_compliant_code': 'Y', 'role_level': 'BLOCKER', 'role_type': 'CodeSmell', 'role_title': '\xe2\x80\x9casync\xe2\x80\x9d\xe5\x92\x8c\xe2\x80\x9c\xe7\xad\x89\xe5\xbe\x85\xe2\x80\x9d\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe7\x94\xa8\xe4\xbd\x9c\xe6\xa0\x87\xe8\xaf\x86\xe7\xac\xa6.', 'role_desc_en': 'Since C# 5.0, async and await are contextual keywords. Contextual keywords do have a particular meaning in some contexts, but can still be used as variable names. Keywords, on the other hand, are always reserved, and therefore are not valid variable names. To avoid any confusion though, it is best to not use async and await as identifiers.', 'role_id': 'S2306', 'role_desc': '\xe8\x87\xaaC\xef\xbc\x835.0\xef\xbc\x8c\xe5\xbc\x82\xe6\xad\xa5\xe7\xad\x89\xe5\xbe\x85\xe6\x98\xaf\xe4\xb8\x8a\xe4\xb8\x8b\xe6\x96\x87\xe5\x85\xb3\xe9\x94\xae\xe5\xad\x97.\xe4\xb8\x8a\xe4\xb8\x8b\xe6\x96\x87\xe5\x85\xb3\xe9\x94\xae\xe5\xad\x97\xe5\x9c\xa8\xe6\x9f\x90\xe4\xba\x9b\xe4\xb8\x8a\xe4\xb8\x8b\xe6\x96\x87\xe4\xb8\xad\xe5\x85\xb7\xe6\x9c\x89\xe7\x89\xb9\xe5\xae\x9a\xe7\x9a\x84\xe5\x90\xab\xe4\xb9\x89\xef\xbc\x8c\xe4\xbd\x86\xe4\xbb\x8d\xe5\x8f\xaf\xe7\x94\xa8\xe4\xbd\x9c\xe5\x8f\x98\xe9\x87\x8f\xe5\x90\x8d\xe7\xa7\xb0.\xe5\x8f\xa6\xe4\xb8\x80\xe6\x96\xb9\xe9\x9d\xa2\xef\xbc\x8c\xe5\x85\xb3\xe9\x94\xae\xe5\xad\x97\xe5\xa7\x8b\xe7\xbb\x88\xe4\xbf\x9d\xe7\x95\x99\xef\xbc\x8c\xe5\x9b\xa0\xe6\xad\xa4\xe4\xb8\x8d\xe6\x98\xaf\xe6\x9c\x89\xe6\x95\x88\xe7\x9a\x84\xe5\x8f\x98\xe9\x87\x8f\xe5\x90\x8d.\xe4\xb8\xba\xe4\xba\x86\xe9\x81\xbf\xe5\x85\x8d\xe6\xb7\xb7\xe6\xb7\x86\xef\xbc\x8c\xe6\x9c\x80\xe5\xa5\xbd\xe4\xb8\x8d\xe8\xa6\x81\xe4\xbd\xbf\xe7\x94\xa8\xe5\xbc\x82\xe6\xad\xa5\xef\xbc\x8c\xe7\xad\x89\xe5\xbe\x85\xe6\xa0\x87\xe8\xaf\x86\xe7\xac\xa6.', 'role_title_en': '"async" and "await" should not be used as identifiers'}

