', 'role_origin_id': 'rule_RSPEC-3875', 'role_have_compliant_code': '', 'role_level': 'BLOCKER', 'role_type': 'CodeSmell', 'role_title': '\xe2\x80\x9coperator ==\xe2\x80\x9d\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe5\x9c\xa8\xe5\xbc\x95\xe7\x94\xa8\xe7\xb1\xbb\xe5\x9e\x8b\xe4\xb8\x8a\xe9\x87\x8d\xe8\xbd\xbd.', 'role_desc_en': "The use of == to compare to objects is expected to do a reference comparison. That is, it is expected to return true if and only if they are the same object instance. Overloading the operator to do anything else will inevitably lead to the introduction of bugs by callers. On the other hand, overloading it to do exactly that is pointless; that's what == does by default.", 'role_id': 'S3875', 'role_desc': '\xe4\xbd\xbf\xe7\x94\xa8==\xe6\x9d\xa5\xe6\xaf\x94\xe8\xbe\x83\xe5\xaf\xb9\xe8\xb1\xa1\xe6\x9c\x89\xe6\x9c\x9b\xe5\x81\x9a\xe4\xb8\x80\xe4\xb8\xaa\xe5\x8f\x82\xe8\x80\x83\xe6\xaf\x94\xe8\xbe\x83.\xe4\xb9\x9f\xe5\xb0\xb1\xe6\x98\xaf\xe8\xaf\xb4\xef\xbc\x8c\xe5\xbd\x93\xe4\xb8\x94\xe4\xbb\x85\xe5\xbd\x93\xe5\xae\x83\xe4\xbb\xac\xe6\x98\xaf\xe7\x9b\xb8\xe5\x90\x8c\xe7\x9a\x84\xe5\xaf\xb9\xe8\xb1\xa1\xe5\xae\x9e\xe4\xbe\x8b\xe6\x97\xb6\xef\xbc\x8c\xe6\x89\x8d\xe4\xbc\x9a\xe8\xbf\x94\xe5\x9b\x9etrue.\xe9\x87\x8d\xe8\xbd\xbd\xe6\x93\x8d\xe4\xbd\x9c\xe5\x91\x98\xe5\x81\x9a\xe4\xbb\xbb\xe4\xbd\x95\xe5\x85\xb6\xe4\xbb\x96\xe6\x93\x8d\xe4\xbd\x9c\xe5\xb0\x86\xe4\xb8\x8d\xe5\x8f\xaf\xe9\x81\xbf\xe5\x85\x8d\xe5\x9c\xb0\xe5\xaf\xbc\xe8\x87\xb4\xe5\x91\xbc\xe5\x8f\xab\xe8\x80\x85\xe5\xbc\x95\xe5\x85\xa5\xe9\x94\x99\xe8\xaf\xaf.\xe5\x8f\xa6\xe4\xb8\x80\xe6\x96\xb9\xe9\x9d\xa2\xef\xbc\x8c\xe8\xb6\x85\xe8\xbd\xbd\xe5\xae\x83\xe5\x81\x9a\xe7\x9a\x84\xe7\xa1\xae\xe6\x98\xaf\xe6\xaf\xab\xe6\x97\xa0\xe6\x84\x8f\xe4\xb9\x89\xe7\x9a\x84;.', 'role_title_en': '"operator==" should not be overloaded on reference types'}

