', 'role_origin_id': 'rule_RSPEC-1006', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'CodeSmell', 'role_title': '\xe6\x96\xb9\xe6\xb3\x95\xe8\xa6\x86\xe7\x9b\x96\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe6\x9b\xb4\xe6\x94\xb9\xe5\x8f\x82\xe6\x95\xb0\xe9\xbb\x98\xe8\xae\xa4\xe5\x80\xbc.', 'role_desc_en': 'Default arguments are determined by the static type of the object. If a default argument is different for a parameter in an overriding method, the value used in the call will be different when calls are made via the base or derived object, which may be contrary to developer expectations. Default parameter values are useless in explicit interface implementations, because the static type of the object will always be the implemented interface. Thus, specifying default values is useless and confusing.', 'role_id': 'S1006', 'role_desc': '\xe9\xbb\x98\xe8\xae\xa4\xe5\x8f\x82\xe6\x95\xb0\xe7\x94\xb1\xe5\xaf\xb9\xe8\xb1\xa1\xe7\x9a\x84\xe9\x9d\x99\xe6\x80\x81\xe7\xb1\xbb\xe5\x9e\x8b\xe5\x86\xb3\xe5\xae\x9a.\xe5\xa6\x82\xe6\x9e\x9c\xe9\xbb\x98\xe8\xae\xa4\xe5\x8f\x82\xe6\x95\xb0\xe5\xaf\xb9\xe4\xba\x8e\xe9\x87\x8d\xe5\x86\x99\xe6\x96\xb9\xe6\xb3\x95\xe4\xb8\xad\xe7\x9a\x84\xe5\x8f\x82\xe6\x95\xb0\xe6\x98\xaf\xe4\xb8\x8d\xe5\x90\x8c\xe7\x9a\x84\xef\xbc\x8c\xe9\x82\xa3\xe4\xb9\x88\xe5\xbd\x93\xe9\x80\x9a\xe8\xbf\x87\xe5\x9f\xba\xe7\xa1\x80\xe6\x88\x96\xe6\xb4\xbe\xe7\x94\x9f\xe5\xaf\xb9\xe8\xb1\xa1\xe8\xbf\x9b\xe8\xa1\x8c\xe8\xb0\x83\xe7\x94\xa8\xe6\x97\xb6\xef\xbc\x8c\xe8\xb0\x83\xe7\x94\xa8\xe4\xb8\xad\xe4\xbd\xbf\xe7\x94\xa8\xe7\x9a\x84\xe5\x80\xbc\xe5\xb0\x86\xe4\xb8\x8d\xe5\x90\x8c\xef\xbc\x8c\xe8\xbf\x99\xe5\x8f\xaf\xe8\x83\xbd\xe4\xb8\x8e\xe5\xbc\x80\xe5\x8f\x91\xe4\xba\xba\xe5\x91\x98\xe7\x9a\x84\xe6\x9c\x9f\xe6\x9c\x9b\xe7\x9b\xb8\xe5\x8f\x8d.\xe9\xbb\x98\xe8\xae\xa4\xe5\x8f\x82\xe6\x95\xb0\xe5\x80\xbc\xe5\x9c\xa8\xe6\x98\xbe\xe5\xbc\x8f\xe6\x8e\xa5\xe5\x8f\xa3\xe5\xae\x9e\xe7\x8e\xb0\xe4\xb8\xad\xe6\x98\xaf\xe6\x97\xa0\xe7\x94\xa8\xe7\x9a\x84\x