', 'role_origin_id': 'rule_RSPEC-3871', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'CodeSmell', 'role_title': '\xe5\xbc\x82\xe5\xb8\xb8\xe7\xb1\xbb\xe5\x9e\x8b\xe5\xba\x94\xe4\xb8\xba\xe2\x80\x9c\xe5\x85\xac\xe5\xbc\x80\xe2\x80\x9d.', 'role_desc_en': "The point of having custom exception types is to convey more information than is available in standard types. But custom exception types must be public for that to work. If a method throws a non-public exception, the best you can do on the caller's side is to catch the closest public base of the class. That is, you lose all that custom information you created the exception type to pass. ", 'role_id': 'S3871', 'role_desc': '\xe5\x85\xb7\xe6\x9c\x89\xe8\x87\xaa\xe5\xae\x9a\xe4\xb9\x89\xe5\xbc\x82\xe5\xb8\xb8\xe7\xb1\xbb\xe5\x9e\x8b\xe7\x9a\x84\xe8\xa6\x81\xe7\x82\xb9\xe6\x98\xaf\xe4\xbc\xa0\xe8\xbe\xbe\xe6\xaf\x94\xe6\xa0\x87\xe5\x87\x86\xe7\xb1\xbb\xe5\x9e\x8b\xe5\x8f\xaf\xe7\x94\xa8\xe7\x9a\x84\xe6\x9b\xb4\xe5\xa4\x9a\xe4\xbf\xa1\xe6\x81\xaf.\xe4\xbd\x86\xe6\x98\xaf\xef\xbc\x8c\xe5\xae\x9a\xe5\x88\xb6\xe7\x9a\x84\xe5\xbc\x82\xe5\xb8\xb8\xe7\xb1\xbb\xe5\x9e\x8b\xe5\xbf\x85\xe9\xa1\xbb\xe6\x98\xaf\xe5\x85\xac\xe5\x85\xb1\xe7\x9a\x84\xe6\x89\x8d\xe8\x83\xbd\xe4\xbd\xbf\xe5\xae\x83\xe5\xb7\xa5\xe4\xbd\x9c.\xe5\xa6\x82\xe6\x9e\x9c\xe4\xb8\x80\xe4\xb8\xaa\xe6\x96\xb9\xe6\xb3\x95\xe6\x8a\x9b\xe5\x87\xba\xe4\xb8\x80\xe4\xb8\xaa\xe9\x9d\x9e\xe5\x85\xac\xe5\xbc\x80\xe7\x9a\x84\xe5\xbc\x82\xe5\xb8\xb8\xef\xbc\x8c\xe9\x82\xa3\xe4\xb9\x88\xe4\xbd\xa0\xe5\x8f\xaf\xe4\xbb\xa5\xe5\x9c\xa8\xe8\xb0\x83\xe7\x94\xa8\xe8\x80\x85\xe6\x96\xb9\xe9\x9d\xa2\xe5\x81\x9a\xe7\x9a\x84\xe6\x9c\x80\xe5\xa5\xbd\xe7\x9a\x84\xe4\xba\x8b\xe6\x83\x85\xe5\xb0\xb1\xe6\x98\xaf\xe6\x8a\x93\xe4\xbd\x8f\xe7\xb1\xbb\xe7\x9a\x84\xe6\x9c\x80\xe6\x8e\xa5\xe8\xbf\x91\xe7\x9a\x84\xe5\x85\xac\xe5\x85\xb1\xe5\x9f\xba\xe7\xa1\x80.\xe4\xb9\x9f\xe5\xb0\xb1\xe6\x98\xaf\xe8\xaf\xb4\xef\xbc\x8c\xe6\x82\xa8\xe5\xb0\x86\xe4\xb8\xa2\xe5\xa4\xb1\xe5\