', 'role_origin_id': 'rule_RSPEC-2290', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'CodeSmell', 'role_title': '\xe5\x9c\xba\xe6\x99\xaf\xe4\xba\x8b\xe4\xbb\xb6\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe6\x98\xaf\xe8\x99\x9a\xe6\x8b\x9f\xe7\x9a\x84.', 'role_desc_en': "Field-like events are events that do not have explicit add and remove methods. The compiler generates a private delegate field to back the event, as well as generating the implicit add and remove methods.When a virtual field-like event is overridden by another field-like event, the behavior of the C# compiler is to generate a new private delegate field in the derived class, separate from the parent's field. This results in multiple and separate events being created, which is rarely what's actually intended.To prevent this, remove the virtual designation from the parent class event.", 'role_id': 'S2290', 'role_desc': '\xe5\x9c\xba\xe7\xb1\xbb\xe4\xba\x8b\xe4\xbb\xb6\xe6\x98\xaf\xe6\xb2\xa1\xe6\x9c\x89\xe6\x98\xbe\xe5\xbc\x8f\xe6\xb7\xbb\xe5\x8a\xa0\xe5\x92\x8c\xe5\x88\xa0\xe9\x99\xa4\xe6\x96\xb9\xe6\xb3\x95\xe7\x9a\x84\xe4\xba\x8b\xe4\xbb\xb6.\xe7\xbc\x96\xe8\xaf\x91\xe5\x99\xa8\xe7\x94\x9f\xe6\x88\x90\xe4\xb8\x80\xe4\xb8\xaa\xe4\xb8\x93\xe7\x94\xa8\xe5\xa7\x94\xe6\x89\x98\xe5\xad\x97\xe6\xae\xb5\xe6\x9d\xa5\xe5\xa4\x87\xe4\xbb\xbd\xe4\xba\x8b\xe4\xbb\xb6\xef\xbc\x8c\xe5\xb9\xb6\xe7\x94\x9f\xe6\x88\x90\xe9\x9a\x90\xe5\xbc\x8f\xe7\x9a\x84add\xe5\x92\x8cremove\xe6\x96\xb9\xe6\xb3\x95.\xe5\xbd\x93\xe7\xb1\xbb\xe4\xbc\xbc\xe8\x99\x9a\xe6\x8b\x9f\xe5\x9c\xba\xe6\x99\xaf\xe7\x9a\x84\xe4\xba\x8b\xe4\xbb\xb6\xe8\xa2\xab\xe5\x8f\xa6\xe4\xb8\x80\xe4\xb8\xaa\xe7\xb1\xbb\xe4\xbc\xbc\xe5\x9c\xba\xe6\x99\xaf\xe7\x9a\x84\xe4\xba\x8b\xe4\xbb\xb6\xe8\xa6\x86\xe7\x9b\x96\xe6\x97\xb6\xef\xbc\x8cC\xef\xbc\x83\xe7\xbc\x96\xe8\xaf\x91\xe5\x99\xa8\xe7\x9a\x84\xe8\xa1\x8c\xe4\xb8\xba\xe6\x98\xaf\xe5\x9c\xa8\xe6\xb4\xbe\xe7\x94\x9f\xe7\xb1\xbb\xe4\xb8\xad\xe7\x94\x9f\xe6\x88\x90\xe4\xb8\x80\xe4\xb8\xaa\x