', 'role_origin_id': 'rule_RSPEC-3597', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'CodeSmell', 'role_title': '\xe5\xba\x94\xe8\xaf\xa5\xe4\xbd\xbf\xe7\x94\xa8\xe2\x80\x9cServiceContract\xe2\x80\x9d\xe5\x92\x8c\xe2\x80\x9cOperationContract\xe2\x80\x9d\xe5\xb1\x9e\xe6\x80\xa7.', 'role_desc_en': "The ServiceContract attribute specifies that a class or interface defines the communication contract of a Windows Communication Foundation (WCF) service. The service operations of this class or interface are defined by OperationContract attributes added to methods. It doesn't make sense to define a contract without any service operations; thus, in a ServiceContract class or interface at least one method should be annotated with OperationContract. Similarly, WCF only serves OperationContract methods that are defined inside ServiceContract classes or interfaces; thus, this rule also checks that ServiceContract is added to the containing type of OperationContract methods.", 'role_id': 'S3597', 'role_desc': 'ServiceContract\xe5\xb1\x9e\xe6\x80\xa7\xe6\x8c\x87\xe5\xae\x9a\xe7\xb1\xbb\xe6\x88\x96\xe6\x8e\xa5\xe5\x8f\xa3\xe5\xae\x9a\xe4\xb9\x89Windows Communication Foundation\xef\xbc\x88WCF\xef\xbc\x89\xe6\x9c\x8d\xe5\x8a\xa1\xe7\x9a\x84\xe9\x80\x9a\xe4\xbf\xa1\xe5\x90\x88\xe5\x90\x8c.\xe6\xad\xa4\xe7\xb1\xbb\xe6\x88\x96\xe6\x8e\xa5\xe5\x8f\xa3\xe7\x9a\x84\xe6\x9c\x8d\xe5\x8a\xa1\xe6\x93\x8d\xe4\xbd\x9c\xe7\x94\xb1\xe6\xb7\xbb\xe5\x8a\xa0\xe5\x88\xb0\xe6\x96\xb9\xe6\xb3\x95\xe7\x9a\x84OperationContract\xe5\xb1\x9e\xe6\x80\xa7\xe5\xae\x9a\xe4\xb9\x89.\xe5\x9c\xa8\xe6\xb2\xa1\xe6\x9c\x89\xe4\xbb\xbb\xe4\xbd\x95\xe6\x9c\x8d\xe5\x8a\xa1\xe6\x93\x8d\xe4\xbd\x9c\xe7\x9a\x84\xe6\x83\x85\xe5\x86\xb5\xe4\xb8\x8b\xe5\xae\x9a\xe4\xb9\x89\xe5\x90\x88\xe5\x90\x8c\xe6\x98\xaf\xe6\xb2\xa1\xe6\x9c\x89\xe6\x84\x8f\xe4\xb9\x89\xe7\x9a\x84;.\xe7\xb1\xbb\xe4\xbc\xbc\xe5\x9c\xb0\xef\xbc\x8cWCF\xe4\xbb\x85\xe6\x8f\x90\xe4\xbe\x9b\xe5\x9c\xa8ServiceContract\xe7\xb1\xbb\xe6\x88\x96\xe6\x8e\xa5\xe5\x8f\xa3\xe4\xb8\xad\xe5\xae\x9a\xe4\xb9\x89\xe7\x9a\x84OperationContract\xe6\x96\xb9\xe6\xb3\x95;.', 'role_title_en': '"ServiceContract" and "OperationContract" attributes should be used together'}

