', 'role_origin_id': 'rule_RSPEC-2996', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'Bug', 'role_title': '\xe2\x80\x9cThreadStatic\xe2\x80\x9d\xe5\xad\x97\xe6\xae\xb5\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe5\x88\x9d\xe5\xa7\x8b\xe5\x8c\x96.', 'role_desc_en': "When an object has a field annotated with ThreadStatic, that field is shared within a given thread, but unique across threads. Since a class' static initializer is only invoked for the first thread created, it also means that only the first thread will have the expected initial values.Instead, allow such fields to be initialized to their default values or make the initialization lazy.", 'role_id': 'S2996', 'role_desc': '\xe5\xbd\x93\xe4\xb8\x80\xe4\xb8\xaa\xe5\xaf\xb9\xe8\xb1\xa1\xe5\x85\xb7\xe6\x9c\x89\xe4\xbd\xbf\xe7\x94\xa8ThreadStatic\xe6\xb3\xa8\xe9\x87\x8a\xe7\x9a\x84\xe5\xad\x97\xe6\xae\xb5\xe6\x97\xb6\xef\xbc\x8c\xe8\xaf\xa5\xe5\xad\x97\xe6\xae\xb5\xe5\x9c\xa8\xe7\xbb\x99\xe5\xae\x9a\xe7\x9a\x84\xe7\xba\xbf\xe7\xa8\x8b\xe5\x86\x85\xe5\x85\xb1\xe4\xba\xab\xef\xbc\x8c\xe4\xbd\x86\xe5\x9c\xa8\xe7\xba\xbf\xe7\xa8\x8b\xe4\xb9\x8b\xe9\x97\xb4\xe6\x98\xaf\xe5\x94\xaf\xe4\xb8\x80\xe7\x9a\x84.\xe7\x94\xb1\xe4\xba\x8e\xe5\x8f\xaa\xe4\xb8\xba\xe7\xac\xac\xe4\xb8\x80\xe4\xb8\xaa\xe7\xba\xbf\xe7\xa8\x8b\xe5\x88\x9b\xe5\xbb\xba\xe4\xba\x86\xe4\xb8\x80\xe4\xb8\xaa\xe9\x9d\x99\xe6\x80\x81\xe5\x88\x9d\xe5\xa7\x8b\xe5\x80\xbc\xe7\xb1\xbb\xef\xbc\x8c\xe6\x89\x80\xe4\xbb\xa5\xe8\xbf\x99\xe4\xb9\x9f\xe6\x84\x8f\xe5\x91\xb3\xe7\x9d\x80\xe5\x8f\xaa\xe6\x9c\x89\xe7\xac\xac\xe4\xb8\x80\xe4\xb8\xaa\xe7\xba\xbf\xe7\xa8\x8b\xe5\xb0\x86\xe5\x85\xb7\xe6\x9c\x89\xe9\xa2\x84\xe6\x9c\x9f\xe7\x9a\x84\xe5\x88\x9d\xe5\xa7\x8b\xe5\x80\xbc.\xe7\x9b\xb8\xe5\x8f\x8d\xef\xbc\x8c\xe5\x85\x81\xe8\xae\xb8\xe5\xb0\x86\xe8\xbf\x99\xe4\xba\x9b\xe5\xad\x97\xe6\xae\xb5\xe5\x88\x9d\xe5\xa7\x8b\xe5\x8c\x96\xe4\xb8\xba\xe5\x85\xb6\xe9\xbb\x98\xe8\xae\xa4\xe5\x80\xbc\xe6\x88\x96\xe4\xbd\xbf\xe5\x88\x9d\xe5\xa7\x8b\xe5\x