', 'role_origin_id': 'rule_RSPEC-3005', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'Bug', 'role_title': '\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe5\x9c\xa8\xe9\x9d\x9e\xe9\x9d\x99\xe6\x80\x81\xe5\xad\x97\xe6\xae\xb5\xe4\xb8\x8a\xe4\xbd\xbf\xe7\x94\xa8\xe2\x80\x9cThreadStatic\xe2\x80\x9d.', 'role_desc_en': "When a non-static class field is annotated with ThreadStatic, the code seems to show that the field can have different values for different calling threads, but that's not the case, since the ThreadStatic attribute is simply ignored on non-static fields. So ThreadStatic should either be removed or replaced with a use of the ThreadLocal&lt;T&gt; class, which gives a similar behavior for non-static fields.", 'role_id': 'S3005', 'role_desc': '\xe5\xbd\x93\xe4\xbd\xbf\xe7\x94\xa8ThreadStatic\xe6\xb3\xa8\xe9\x87\x8a\xe9\x9d\x9e\xe9\x9d\x99\xe6\x80\x81\xe7\xb1\xbb\xe5\xad\x97\xe6\xae\xb5\xe6\x97\xb6\xef\xbc\x8c\xe4\xbb\xa3\xe7\xa0\x81\xe4\xbc\xbc\xe4\xb9\x8e\xe8\xa1\xa8\xe6\x98\x8e\xe8\xaf\xa5\xe5\xad\x97\xe6\xae\xb5\xe5\xaf\xb9\xe4\xba\x8e\xe4\xb8\x8d\xe5\x90\x8c\xe7\x9a\x84\xe8\xb0\x83\xe7\x94\xa8\xe7\xba\xbf\xe7\xa8\x8b\xe5\x8f\xaf\xe4\xbb\xa5\xe5\x85\xb7\xe6\x9c\x89\xe4\xb8\x8d\xe5\x90\x8c\xe7\x9a\x84\xe5\x80\xbc\xef\xbc\x8c\xe4\xbd\x86\xe4\xba\x8b\xe5\xae\x9e\xe5\xb9\xb6\xe9\x9d\x9e\xe5\xa6\x82\xe6\xad\xa4\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xbaThreadStatic\xe5\xb1\x9e\xe6\x80\xa7\xe5\x9c\xa8\xe9\x9d\x9e\xe9\x9d\x99\xe6\x80\x81\xe5\xad\x97\xe6\xae\xb5\xe4\xb8\x8a\xe8\xa2\xab\xe7\xae\x80\xe5\x8d\x95\xe5\x9c\xb0\xe5\xbf\xbd\xe7\x95\xa5.\xe6\x89\x80\xe4\xbb\xa5ThreadStatic\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe4\xbd\xbf\xe7\x94\xa8ThreadLocal\xef\xbc\x86lt; T\xef\xbc\x86gt;.', 'role_title_en': '"ThreadStatic" should not be used on non-static fields'}

