', 'role_origin_id': 'rule_RSPEC-3168', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'Bug', 'role_title': '\xe2\x80\x9c\xe5\xbc\x82\xe6\xad\xa5\xe2\x80\x9d\xe6\x96\xb9\xe6\xb3\x95\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe8\xbf\x94\xe5\x9b\x9e\xe2\x80\x9cvoid\xe2\x80\x9d.', 'role_desc_en': 'An async method with a void return type is a "fire and forget" method best reserved for event handlers because there's no way to wait for the method's execution to complete and respond accordingly. There's also no way to catch exceptions thrown from the method.Having an async void method that is not an event handler could mean your program works some times and not others because of timing issues. Instead, async methods should return Task.This rule raises an issue when non-event handler methods are both async and void.', 'role_id': 'S3168', 'role_desc': '\xe5\x85\xb7\xe6\x9c\x89void\xe8\xbf\x94\xe5\x9b\x9e\xe7\xb1\xbb\xe5\x9e\x8b\xe7\x9a\x84\xe5\xbc\x82\xe6\xad\xa5\xe6\x96\xb9\xe6\xb3\x95\xe6\x98\xaf\xe5\xaf\xb9\xe4\xba\x8b\xe4\xbb\xb6\xe5\xa4\x84\xe7\x90\x86\xe7\xa8\x8b\xe5\xba\x8f\xe6\x9c\x80\xe5\xa5\xbd\xe7\x9a\x84\xe2\x80\x9cfire and forget\xe2\x80\x9d\xe6\x96\xb9\xe6\xb3\x95\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe6\x97\xa0\xe6\xb3\x95\xe7\xad\x89\xe5\xbe\x85\xe6\x96\xb9\xe6\xb3\x95\xe7\x9a\x84\xe6\x89\xa7\xe8\xa1\x8c\xe5\xae\x8c\xe6\x88\x90\xe5\xb9\xb6\xe7\x9b\xb8\xe5\xba\x94\xe5\x9c\xb0\xe8\xbf\x9b\xe8\xa1\x8c\xe5\x93\x8d\xe5\xba\x94.\xe4\xb9\x9f\xe6\xb2\xa1\xe6\x9c\x89\xe5\x8a\x9e\xe6\xb3\x95\xe6\x8d\x95\xe8\x8e\xb7\xe4\xbb\x8e\xe6\x96\xb9\xe6\xb3\x95\xe6\x8a\x9b\xe5\x87\xba\xe7\x9a\x84\xe5\xbc\x82\xe5\xb8\xb8.\xe4\xbd\xbf\xe7\x94\xa8\xe4\xb8\x8d\xe6\x98\xaf\xe4\xba\x8b\xe4\xbb\xb6\xe5\xa4\x84\xe7\x90\x86\xe7\xa8\x8b\xe5\xba\x8f\xe7\x9a\x84\xe5\xbc\x82\xe6\xad\xa5void\xe6\x96\xb9\xe6\xb3\x95\xe5\x8f\xaf\xe8\x83\xbd\xe6\x84\x8f\xe5\x91\xb3\xe7\x9d\x80\xe6\x82\xa8\xe7\x9a\x84\xe7\xa8\x8b\xe5\xba\x8f\xe5\x8f\xaf\xe4\xbb\xa5\xe5\xb7\xa5\xe4\xbd\x9c\xe4\xb8\x8