', 'role_origin_id': 'rule_RSPEC-3244', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'Bug', 'role_title': '\xe5\x8c\xbf\xe5\x90\x8d\xe4\xbb\xa3\xe8\xa1\xa8\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe7\x94\xa8\xe6\x9d\xa5\xe5\x8f\x96\xe6\xb6\x88\xe8\xae\xa2\xe9\x98\x85\xe4\xba\x8b\xe4\xbb\xb6.', 'role_desc_en': "It is possible to subscribe to events with anonymous delegates, but having done so, it is impossible to unsubscribe from them. That's because the process of subscribing adds the delegate to a list. The process of unsubscribing essentially says: remove this item from the subscription list. But because an anonymous delegate was used in both cases, the unsubscribe attempt tries to remove a different item from the list than was added. The result: NOOP.Instead, save the delegate to a variable and use the variable to subscribe and unsubscribe.", 'role_id': 'S3244', 'role_desc': '\xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbd\xbf\xe7\x94\xa8\xe5\x8c\xbf\xe5\x90\x8d\xe4\xbb\xa3\xe8\xa1\xa8\xe8\xae\xa2\xe9\x98\x85\xe4\xba\x8b\xe4\xbb\xb6\xef\xbc\x8c\xe4\xbd\x86\xe6\x98\xaf\xe8\xbf\x99\xe6\xa0\xb7\xe5\x81\x9a\xe6\x98\xaf\xe4\xb8\x8d\xe5\x8f\xaf\xe8\x83\xbd\xe5\x8f\x96\xe6\xb6\x88\xe8\xae\xa2\xe9\x98\x85\xe7\x9a\x84.\xe8\xbf\x99\xe6\x98\xaf\xe5\x9b\xa0\xe4\xb8\xba\xe8\xae\xa2\xe9\x98\x85\xe8\xbf\x87\xe7\xa8\x8b\xe5\xb0\x86\xe5\xa7\x94\xe6\x89\x98\xe6\xb7\xbb\xe5\x8a\xa0\xe5\x88\xb0\xe5\x88\x97\xe8\xa1\xa8\xe4\xb8\xad.\xe5\x8f\x96\xe6\xb6\x88\xe8\xae\xa2\xe9\x98\x85\xe7\x9a\x84\xe8\xbf\x87\xe7\xa8\x8b\xe5\x9f\xba\xe6\x9c\xac\xe4\xb8\x8a\xe8\xaf\xb4\xef\xbc\x9a\xe4\xbb\x8e\xe8\xae\xa2\xe9\x98\x85\xe5\x88\x97\xe8\xa1\xa8\xe4\xb8\xad\xe5\x88\xa0\xe9\x99\xa4\xe6\xad\xa4\xe9\xa1\xb9.\xe4\xbd\x86\xe6\x98\xaf\xe5\x9b\xa0\xe4\xb8\xba\xe5\x9c\xa8\xe8\xbf\x99\xe4\xb8\xa4\xe7\xa7\x8d\xe6\x83\x85\xe5\x86\xb5\xe4\xb8\x8b\xe9\x83\xbd\xe4\xbd\xbf\xe7\x94\xa8\xe4\xba\x86\xe5\x8c\xbf\xe5\x90\x8d\xe5\xa7\x94\xe6\x89\x98\xef\xbc\x8c\xe6\x89\x80\xe4\xbb\xa5\xe5\x8f\x96\xe6\