', 'role_origin_id': 'rule_RSPEC-3897', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'CodeSmell', 'role_title': '\xe6\x8f\x90\xe4\xbe\x9b\xe2\x80\x9cEquals\xef\xbc\x88\u003cT\u003e\xef\xbc\x89\xe2\x80\x9d\xe6\x88\x96\xe8\xa6\x86\xe7\x9b\x96\xe2\x80\x9cEquals\xef\xbc\x88Object\xef\xbc\x89\xe2\x80\x9d\xe7\x9a\x84\xe7\xb1\xbb\xe5\xba\x94\xe5\xae\x9e\xe7\x8e\xb0\xe2\x80\x9cIEquatable \u003cT\u003e\xe2\x80\x9d.', 'role_desc_en': "The IEquatable&lt;T&gt; interface has only one method in it: Equals(&lt;T&gt;). If you've already written Equals(T), there's no reason not to explicitly implement IEquatable&lt;T&gt;. Doing so expands the utility of your class by allowing it to be used where an IEquatable is called for.Similarly, having written Equals(&lt;T&gt;), it's not that much further to go to write Equals(Object) and vice versa; just a couple more lines brings a large dividend of functionality. So this rule raises an issue when Equals(&lt;T&gt;) is not accompanied by IEquatable and Equals(Object), and vice versa.", 'role_id': 'S3897', 'role_desc': 'IEquatable\xef\xbc\x86lt; T\xef\xbc\x86gt;.\xe5\xa6\x82\xe6\x9e\x9c\xe4\xbd\xa0\xe5\xb7\xb2\xe7\xbb\x8f\xe5\x86\x99\xe4\xba\x86Equals\xef\xbc\x88T\xef\xbc\x89\xef\xbc\x8c\xe9\x82\xa3\xe4\xb9\x88\xe6\xb2\xa1\xe6\x9c\x89\xe7\x90\x86\xe7\x94\xb1\xe4\xb8\x8d\xe6\x98\x8e\xe7\xa1\xae\xe5\x9c\xb0\xe5\xae\x9e\xe7\x8e\xb0IEquatable\xef\xbc\x86T;.\xe8\xbf\x99\xe6\xa0\xb7\xe5\x81\x9a\xe5\x8f\xaf\xe4\xbb\xa5\xe6\x89\xa9\xe5\xb1\x95\xe6\x82\xa8\xe7\x9a\x84\xe7\xb1\xbb\xe7\x9a\x84\xe5\xae\x9e\xe7\x94\xa8\xe7\xa8\x8b\xe5\xba\x8f\xef\xbc\x8c\xe6\x96\xb9\xe6\xb3\x95\xe6\x98\xaf\xe5\xb0\x86\xe5\x85\xb6\xe7\x94\xa8\xe4\xba\x8e\xe8\xb0\x83\xe7\x94\xa8IEquatable\xe7\x9a\x84\xe4\xbd\x8d\xe7\xbd\xae.\xe7\xb1\xbb\xe4\xbc\xbc\xe5\x9c\xb0\xef\xbc\x8c\xe5\x9c\xa8\xe5\x86\x99\xe5\x85\xa5Equals\xef\xbc\x88\xef\xbc\x86lt; T\xef\xbc\x89\xef\xbc\x89\xe6\x97\xb6\xef\xbc\x8c\xe5\x86\x99\xe5\x85\xa5Equals\xef\xbc\x88Object\xef\xbc\x89\xe5\