', 'role_have_noncompliant_code': '', 'role_noncompliant_code': '', 'role_origin_id': 'rule_RSPEC-2933', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'CodeSmell', 'role_title': '\xe4\xbb\x85\xe5\x9c\xa8\xe6\x9e\x84\xe9\x80\xa0\xe5\x87\xbd\xe6\x95\xb0\xe4\xb8\xad\xe5\x88\x86\xe9\x85\x8d\xe7\x9a\x84\xe5\xad\x97\xe6\xae\xb5\xe5\xba\x94\xe4\xb8\xba\xe2\x80\x9c\xe5\x8f\xaa\xe8\xaf\xbb\xe2\x80\x9d.', 'role_desc_en': "readonly fields can only be assigned in a class constructor. If a class has a field that's not marked readonly but is only set in the constructor, it could cause confusion about the field's intended use. To avoid confusion, such fields should be marked readonly to make their intended use explicit, and to prevent future maintainers from inadvertently changing their use.", 'role_id': 'S2933', 'role_desc': '\xe5\x8f\xaa\xe8\xaf\xbb\xe5\xad\x97\xe6\xae\xb5\xe5\x8f\xaa\xe8\x83\xbd\xe5\x9c\xa8\xe7\xb1\xbb\xe6\x9e\x84\xe9\x80\xa0\xe5\x87\xbd\xe6\x95\xb0\xe4\xb8\xad\xe5\x88\x86\xe9\x85\x8d.\xe5\xa6\x82\xe6\x9e\x9c\xe4\xb8\x80\xe4\xb8\xaa\xe7\xb1\xbb\xe6\xb2\xa1\xe6\x9c\x89\xe6\xa0\x87\xe8\xae\xb0\xe4\xb8\xba\xe5\x8f\xaa\xe8\xaf\xbb\xe7\x9a\x84\xe5\xad\x97\xe6\xae\xb5\xef\xbc\x8c\xe4\xbd\x86\xe5\x8f\xaa\xe8\x83\xbd\xe5\x9c\xa8\xe6\x9e\x84\xe9\x80\xa0\xe5\x87\xbd\xe6\x95\xb0\xe4\xb8\xad\xe8\xae\xbe\xe7\xbd\xae\xef\xbc\x8c\xe9\x82\xa3\xe4\xb9\x88\xe5\x8f\xaf\xe8\x83\xbd\xe4\xbc\x9a\xe5\xaf\xbc\xe8\x87\xb4\xe5\xaf\xb9\xe5\xad\x97\xe6\xae\xb5\xe7\x9a\x84\xe9\xa2\x84\xe6\x9c\x9f\xe7\x94\xa8\xe9\x80\x94\xe7\x9a\x84\xe6\xb7\xb7\xe6\xb7\x86.\xe4\xb8\xba\xe4\xba\x86\xe9\x81\xbf\xe5\x85\x8d\xe6\xb7\xb7\xe6\xb7\x86\xef\xbc\x8c\xe8\xbf\x99\xe4\xba\x9b\xe5\xad\x97\xe6\xae\xb5\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe6\xa0\x87\xe8\xae\xb0\xe4\xb8\xba\xe5\x8f\xaa\xe8\xaf\xbb\xef\xbc\x8c\xe4\xbb\xa5\xe4\xbd\xbf\xe5\x85\xb6\xe7\x94\xa8\xe9\x80\x94\xe6\x98\x8e\xe7\xa1\xae\xef\xbc\x8c\xe5\xb9\xb6\xe9\x98\xb2\xe6\xad\xa2\xe6\x9c\xaa\xe6\x9d\xa5\xe7\x9a\x84\xe7\xbb\xb