', 'role_origin_id': 'rule_RSPEC-3246', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'CodeSmell', 'role_title': '\xe9\x80\x9a\xe7\x94\xa8\xe5\x9e\x8b\xe5\x8f\x82\xe6\x95\xb0\xe5\xba\x94\xe5\xb0\xbd\xe5\x8f\xaf\xe8\x83\xbd\xe5\x85\xb1\xe5\x90\x8c/\xe7\x9b\xb8\xe5\x8f\x8d.', 'role_desc_en': 'In the interests of making code as usable as possible, interfaces and delegates with generic parameters should use the out and in modifiers when possible to make the interfaces and delegates covariant and contravariant, respectively.The out keyword can be used when the type parameter is used only as a return type in the interface or delegate. Doing so makes the parameter covariant, and allows interface and delegate instances created with a sub-type to be used as instances created with a base type. The most notable example of this is IEnumerable&lt;out T&gt;, which allows the assignment of an IEnumerable&lt;string&gt; instance to an IEnumerable&lt;object&gt; variable, for instance.The in keyword can be used when the type parameter is used only as a method parameter in the interface or a parameter in the delegate. Doing so makes the parameter contravariant, and allows interface and delegate instances created with a base type to be used as instances created with a sub-type. I.e. this is the inversion of covariance. The most notable example of this is the Action&lt;in T&gt; delegate, which allows the assignment of an Action&lt;object&gt; instance to a Action&lt;string&gt; variable, for instance.', 'role_id': 'S3246', 'role_desc': '\xe4\xb8\xba\xe4\xba\x86\xe5\xb0\xbd\xe5\x8f\xaf\xe8\x83\xbd\xe4\xbd\xbf\xe4\xbb\xa3\xe7\xa0\x81\xe5\xb0\xbd\xe5\x8f\xaf\xe8\x83\xbd\xe5\x9c\xb0\xe4\xbd\xbf\xe7\x94\xa8\xef\xbc\x8c\xe5\x85\xb7\xe6\x9c\x89\xe9\x80\x9a\xe7\x94\xa8\xe5\x8f\x82\xe6\x95\xb0\xe7\x9a\x84\xe6\x8e\xa5\xe5\x8f\xa3\xe5\x92\x8c\xe5\xa7\x94\xe6\x89\x98\xe5\xba\x94\xe8\xaf\xa5\xe5\x9c\xa8\xe5\x8f\xaf\xe8\x83\xbd\xe6\x97\xb6\xe4\xbd\xbf\xe7\x94\xa8out\xe5\x92\x8cin\xe4\xbf\xae\xe9\xa5\xb0\xe7\xac\xa6\xe5\x88\x86\xe5\x88\xab\xe4\xbd\xbf\xe6\x8e\xa5\xe5\x8f\xa3\xe5\x92\x8c\xe5\xa7\x94\xe6\x89\x98\xe5\x8d\x8f\xe5\x8f\x98\xe9\x87\x8f\xe5\x92\x8c\xe5\x8f\x8d\xe5\x8f\x98\xe6\x8d\xa2.\xe5\xbd\x93\xe7\xb1\xbb\xe5\x9e\x8b\xe5\x8f\x82\xe6\x95\xb0\xe4\xbb\x85\xe5\x9c\xa8\xe6\x8e\xa5\xe5\x8f\xa3\xe6\x88\x96\xe5\xa7\x94\xe6\x89\x98\xe4\xb8\xad\xe4\xbd\x9c\xe4\xb8\xba\xe8\xbf\x94\xe5\x9b\x9e\xe7\xb1\xbb\xe5\x9e\x8b\xe4\xbd\xbf\xe7\x94\xa8\xe6\x97\xb6\xef\xbc\x8c\xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbd\xbf\xe7\x94\xa8out\xe5\x85\xb3\xe9\x94\xae\xe5\xad\x97.\xe8\xbf\x99\xe6\xa0\xb7\xe5\x81\x9a\xe4\xbd\xbf\xe5\x8f\x82\xe6\x95\xb0\xe5\x8d\x8f\xe5\x8f\x98\xef\xbc\x8c\xe5\xb9\xb6\xe5\x85\x81\xe8\xae\xb8\xe4\xbd\xbf\xe7\x94\xa8\xe5\xad\x90\xe7\xb1\xbb\xe5\x88\x9b\xe5\xbb\xba\xe7\x9a\x84\xe6\x8e\xa5\xe5\x8f\xa3\xe5\x92\x8c\xe5\xa7\x94\xe6\x89\x98\xe5\xae\x9e\xe4\xbe\x8b\xe4\xbd\x9c\xe4\xb8\xba\xe4\xbd\xbf\xe7\x94\xa8\xe5\x9f\xba\xe6\x9c\xac\xe7\xb1\xbb\xe5\x9e\x8b\xe5\x88\x9b\xe5\xbb\xba\xe7\x9a\x84\xe5\xae\x9e\xe4\xbe\x8b.\xe5\x85\xb6\xe4\xb8\xad\xe6\x9c\x80\xe6\x98\xbe\xe7\x9d\x80\xe7\x9a\x84\xe4\xbe\x8b\xe5\xad\x90\xe6\x98\xafIEnumerable\xef\xbc\x86lt; out T\xef\xbc\x86gt;\xef\xbc\x8c\xe5\x85\xb6\xe5\x85\x81\xe8\xae\xb8\xe5\x88\x86\xe9\x85\x8dIEnumerable\xef\xbc\x86lt; string\xef\xbc\x86gt;.\xe5\xbd\x93type\xe5\x8f\x82\xe6\x95\xb0\xe4\xbb\x85\xe7\x94\xa8\xe4\xbd\x9c\xe6\x8e\xa5\xe5\x8f\xa3\xe4\xb8\xad\xe7\x9a\x84\xe6\x96\xb9\xe6\xb3\x95\xe5\x8f\x82\xe6\x95\xb0\xe6\x88\x96\xe5\xa7\x94\xe6\x89\x98\xe4\xb8\xad\xe7\x9a\x84\xe5\x8f\x82\xe6\x95\xb0\xe6\x97\xb6\xef\xbc\x8c\xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbd\xbf\xe7\x94\xa8in\xe5\x85\xb3\xe9\x94\xae\xe5\xad\x97.\xe8\xbf\x99\xe6\xa0\xb7\xe5\x81\x9a\xe4\xbc\x9a\xe4\xbd\xbf\xe5\x8f\x82\xe6\x95\xb0\xe7\x9b\xb8\xe5\x8f\x8d\xef\xbc\x8c\xe5\xb9\xb6\xe5\x85\x81\xe8\xae\xb8\xe4\xbd\xbf\xe7\x94\xa8\xe5\x9f\xba\xe6\x9c\xac\xe7\xb1\xbb\xe5\x9e\x8b\xe5\x88\x9b\xe5\xbb\xba\xe7\x9a\x84\xe6\x8e\xa5\xe5\x8f\xa3\xe5\x92\x8c\xe5\xa7