', 'role_origin_id': 'rule_RSPEC-3887', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'Bug', 'role_title': '\xe5\x8f\xaf\xe5\x8f\x98\xe7\x9a\x84\xe9\x9d\x9e\xe7\xa7\x81\xe4\xba\xba\xe5\xad\x97\xe6\xae\xb5\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe6\x98\xaf\xe2\x80\x9c\xe5\x8f\xaa\xe8\xaf\xbb\xe2\x80\x9d.', 'role_desc_en': "Using the readonly keyword on a field means that it can't be changed after initialization. However, when applied to collections or arrays, that's only partly true. readonly enforces that another instance can't be assigned to the field, but it cannot keep the contents from being updated. That  means that in practice, the field value really can be changed, and the use of readonly on such a field is misleading, and you're likely to not be getting the behavior you expect.This rule raises an issue when a non-private, readonly field is an array or collection.", 'role_id': 'S3887', 'role_desc': '\xe5\x9c\xa8\xe5\xad\x97\xe6\xae\xb5\xe4\xb8\x8a\xe4\xbd\xbf\xe7\x94\xa8readonly\xe5\x85\xb3\xe9\x94\xae\xe5\xad\x97\xe6\x84\x8f\xe5\x91\xb3\xe7\x9d\x80\xe5\x9c\xa8\xe5\x88\x9d\xe5\xa7\x8b\xe5\x8c\x96\xe5\x90\x8e\xe4\xb8\x8d\xe8\x83\xbd\xe6\x9b\xb4\xe6\x94\xb9.\xe7\x84\xb6\xe8\x80\x8c\xef\xbc\x8c\xe5\xbd\x93\xe5\xba\x94\xe7\x94\xa8\xe4\xba\x8e\xe9\x9b\x86\xe5\x90\x88\xe6\x88\x96\xe6\x95\xb0\xe7\xbb\x84\xe6\x97\xb6\xef\xbc\x8c\xe8\xbf\x99\xe4\xbb\x85\xe4\xbb\x85\xe6\x98\xaf\xe9\x83\xa8\xe5\x88\x86\xe7\x9a\x84.readonly\xe5\xbc\xba\xe5\x88\xb6\xe5\x8f\xa6\xe4\xb8\x80\xe4\xb8\xaa\xe5\xae\x9e\xe4\xbe\x8b\xe4\xb8\x8d\xe8\x83\xbd\xe5\x88\x86\xe9\x85\x8d\xe5\x88\xb0\xe8\xaf\xa5\xe5\xad\x97\xe6\xae\xb5\xef\xbc\x8c\xe4\xbd\x86\xe5\xae\x83\xe4\xb8\x8d\xe8\x83\xbd\xe4\xbf\x9d\xe6\x8c\x81\xe5\x86\x85\xe5\xae\xb9\xe4\xb8\x8d\xe8\xa2\xab\xe6\x9b\xb4\xe6\x96\xb0.\xe8\xbf\x99\xe6\x84\x8f\xe5\x91\xb3\xe7\x9d\x80\xe5\x9c\xa8\xe5\xae\x9e\xe8\xb7\xb5\xe4\xb8\xad\xef\xbc\x8c\xe7\x8e\xb0\xe5\x9c\xba\xe4\xbb\xb7\xe5\x80\xbc\xe5\xae\x9e\xe9\x99\x85\xe4\xb8\x8a\xe5\x8f\