', 'role_origin_id': 'rule_RSPEC-3874', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'CodeSmell', 'role_title': '\xe2\x80\x9cout\xe2\x80\x9d\xe5\x92\x8c\xe2\x80\x9cref\xe2\x80\x9d\xe5\x8f\x82\xe6\x95\xb0\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe4\xbd\xbf\xe7\x94\xa8.', 'role_desc_en': "Passing a parameter by reference, which is what happens when you use the out or ref parameter modifiers, means that the method will receive a pointer to the argument, rather than the argument itself. If the argument was a value type, the method will be able to change the argument's values. If it was a reference type, then the method receives a pointer to a pointer, which is usually not what was intended. Even when it is what was intended, this is the sort of thing that's difficult to get right, and should be used with caution.This rule raises an issue when out or ref is used on a non-Optional parameter in a public method. Optional parameters are covered by S3447.", 'role_id': 'S3874', 'role_desc': '\xe9\x80\x9a\xe8\xbf\x87\xe5\xbc\x95\xe7\x94\xa8\xe4\xbc\xa0\xe9\x80\x92\xe5\x8f\x82\xe6\x95\xb0\xef\xbc\x8c\xe5\xbd\x93\xe4\xbd\xbf\xe7\x94\xa8out\xe6\x88\x96ref\xe5\x8f\x82\xe6\x95\xb0\xe4\xbf\xae\xe9\xa5\xb0\xe7\xac\xa6\xe6\x97\xb6\xe4\xbc\x9a\xe5\x8f\x91\xe7\x94\x9f\xe4\xbb\x80\xe4\xb9\x88\xef\xbc\x8c\xe6\x84\x8f\xe5\x91\xb3\xe7\x9d\x80\xe8\xaf\xa5\xe6\x96\xb9\xe6\xb3\x95\xe5\xb0\x86\xe6\x8e\xa5\xe6\x94\xb6\xe5\x88\xb0\xe5\x8f\x82\xe6\x95\xb0\xe7\x9a\x84\xe6\x8c\x87\xe9\x92\x88\xef\xbc\x8c\xe8\x80\x8c\xe4\xb8\x8d\xe6\x98\xaf\xe5\x8f\x82\xe6\x95\xb0\xe6\x9c\xac\xe8\xba\xab.\xe5\xa6\x82\xe6\x9e\x9c\xe5\x8f\x82\xe6\x95\xb0\xe6\x98\xaf\xe5\x80\xbc\xe7\xb1\xbb\xe5\x9e\x8b\xef\xbc\x8c\xe5\x88\x99\xe8\xaf\xa5\xe6\x96\xb9\xe6\xb3\x95\xe5\xb0\x86\xe8\x83\xbd\xe5\xa4\x9f\xe6\x9b\xb4\xe6\x94\xb9\xe5\x8f\x82\xe6\x95\xb0\xe7\x9a\x84\xe5\x80\xbc.\xe5\xa6\x82\xe6\x9e\x9c\xe5\xae\x83\xe6\x98\xaf\xe4\xb8\x80\xe4\xb8\xaa\xe5\xbc\x95\xe7\x94\xa8\xe7\xb1\xbb\xe5\x9e\x8b\xef\xbc\x8c\