abstract class Fruit { }
class Apple : Fruit { }
class Orange : Fruit { }

class Program
{
  static void Main(string[] args)
  {
    Fruit[] fruits = new Apple[1]; // Noncompliant - array covariance is used
    FillWithOranges(fruits);
  }

  // Just looking at the code doesn't reveal anything suspicious
  static void FillWithOranges(Fruit[] fruits)
  {
    for (int i = 0; i &lt; fruits.Length; i++)
    {
      fruits[i] = new Orange(); // Will throw an ArrayTypeMismatchException
    }
  }
}

", 'role_origin_id': 'rule_RSPEC-2330', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'CodeSmell', 'role_title': '\xe4\xb8\x8d\xe5\xba\x94\xe4\xbd\xbf\xe7\x94\xa8\xe9\x98\xb5\xe5\x88\x97\xe5\x8d\x8f\xe6\x96\xb9\xe5\xb7\xae.', 'role_desc_en': 'Array covariance is the principle that if an implicit or explicit reference conversion exits from type A to B, then the same conversion exists from the array type A[] to B[].While this array conversion can be useful in readonly situations to pass instances of A[] where B[] is expected, it must be used with care, since assigning an instance of B into an array of A will cause an ArrayTypeMismatchException to be thrown at runtime.', 'role_id': 'S2330', 'role_desc': '\xe6\x95\xb0\xe7\xbb\x84\xe5\x8d\x8f\xe6\x96\xb9\xe5\xb7\xae\xe6\x98\xaf\xe5\x8e\x9f\xe5\x88\x99\xef\xbc\x8c\xe5\xa6\x82\xe6\x9e\x9c\xe9\x9a\x90\xe5\xbc\x8f\xe6\x88\x96\xe6\x98\xbe\xe5\xbc\x8f\xe5\xbc\x95\xe7\x94\xa8\xe8\xbd\xac\xe6\x8d\xa2\xe9\x80\x80\xe5\x87\xbaA\xe7\xb1\xbb\xe5\x88\xb0B\xe7\xb1\xbb\xef\xbc\x8c\xe9\x82\xa3\xe4\xb9\x88\xe4\xbb\x8e\xe6\x95\xb0\xe7\xbb\x84\xe7\xb1\xbb\xe5\x9e\x8bA []\xe5\x88\xb0B []\xe5\xad\x98\xe5\x9c\xa8\xe7\x9b\xb8\xe5\x90\x8c\xe7\x9a\x84\xe8\xbd\xac\xe6\x8d\xa2.\xe8\x99\xbd\xe7\x84\xb6\xe8\xbf\x99\xe7\xa7\x8d\xe6\x95\xb0\xe7\xbb\x84\xe8\xbd\xac\xe6\x8d\xa2\xe5\x9c\xa8\xe5\x8f\xaa\xe8\xaf\xbb\xe7\x8a\xb6\xe5\x86\xb5\xe4\xb8\x8b\xe5\x8f\xaf\xe4\xbb\xa5\xe6\x9c\x89\xe6\x95\x88\xe5\x9c\xb0\xe4\xbc\xa0\xe9\x80\x92\xe9\x9c\x80\xe8\xa6\x81B []\xe7\x9a\x84A []\xe7\x9a\x84\xe5\xae\x9e\xe4\xbe\x8b\xef\xbc\x8c\xe4\xbd\x86\xe5\xbf\x85\xe9\xa1\xbb\xe8\xb0\xa8\xe6\x85\x8e\xe4\xbd\xbf\xe7\x94\xa8\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe5\xb0\x86B\xe7\x9a\x84\xe5\xae\x9e\xe4\xbe\x8b\xe5\x88\x86\xe9\x85\x8d\xe5\x88\xb0A\xe7\x9a\x84\xe6\x95\xb0\xe7\xbb\x84\xe5\xb0\x86\xe5\xaf\xbc\xe8\x87\xb4ArrayTypeMismatchException\xe6\x8a\x9b\xe5\x87\xba.', 'role_title_en': 'Array covariance should not be used'}

