', 'role_origin_id': 'rule_RSPEC-2070', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'Vulnerability', 'role_title': '\xe4\xb8\x8d\xe5\xba\x94\xe4\xbd\xbf\xe7\x94\xa8SHA-1\xe5\x92\x8c\xe6\xb6\x88\xe6\x81\xaf\xe6\x91\x98\xe8\xa6\x81\xe6\x95\xa3\xe5\x88\x97\xe7\xae\x97\xe6\xb3\x95.', 'role_desc_en': 'The MD5 algorithm and its successor, SHA-1, are no longer considered secure, because it is too easy to create hash collisions with them. That is, it takes too little computational effort to come up with a different input that produces the same MD5 or SHA-1 hash, and using the new, same-hash value gives an attacker the same access as if he had the originally-hashed value. This applies as well to the other Message-Digest algorithms: MD2, MD4, MD6.This rule tracks usage of the System.Security.Cryptography.CryptoConfig.CreateFromName(), and System.Security.Cryptography.HashAlgorithm.Create() methods to instantiate MD5 or SHA-1 algorithms, and of derived class instances of System.Security.Cryptography.SHA1 and System.Security.Cryptography.MD5.', 'role_id': 'S2070', 'role_desc': 'MD5\xe7\xae\x97\xe6\xb3\x95\xe5\x8f\x8a\xe5\x85\xb6\xe5\x90\x8e\xe7\xbb\xa7SHA-1\xe4\xb8\x8d\xe5\x86\x8d\xe8\xa2\xab\xe8\xae\xa4\xe4\xb8\xba\xe6\x98\xaf\xe5\xae\x89\xe5\x85\xa8\xe7\x9a\x84\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe5\xae\x83\xe4\xbb\xac\xe5\xa4\xaa\xe5\xae\xb9\xe6\x98\x93\xe4\xb8\x8e\xe5\xae\x83\xe4\xbb\xac\xe5\x88\x9b\xe5\xbb\xba\xe5\x93\x88\xe5\xb8\x8c\xe5\x86\xb2\xe7\xaa\x81.\xe4\xb9\x9f\xe5\xb0\xb1\xe6\x98\xaf\xe8\xaf\xb4\xef\xbc\x8c\xe9\x9c\x80\xe8\xa6\x81\xe5\xa4\xaa\xe5\xb0\x91\xe7\x9a\x84\xe8\xae\xa1\xe7\xae\x97\xe9\x87\x8f\xe6\x9d\xa5\xe4\xba\xa7\xe7\x94\x9f\xe4\xba\xa7\xe7\x94\x9f\xe7\x9b\xb8\xe5\x90\x8cMD5\xe6\x88\x96SHA-1\xe6\x95\xa3\xe5\x88\x97\xe7\x9a\x84\xe4\xb8\x8d\xe5\x90\x8c\xe8\xbe\x93\xe5\x85\xa5\xef\xbc\x8c\xe5\xb9\xb6\xe4\xb8\x94\xe4\xbd\xbf\xe7\x94\xa8\xe6\x96\xb0\xe7\x9a\x84\xe7\x9b\xb8\xe5\x90\x8c\xe6\x95\xa3\xe5\x88\x97\xe5\x80\xbc\xe7\xbb