', 'role_origin_id': 'rule_RSPEC-2551', 'role_have_compliant_code': 'Y', 'role_level': 'CRITICAL', 'role_type': 'Bug', 'role_title': '\xe7\xb1\xbb\xe5\x9e\x8b\xe5\x92\x8c\xe2\x80\x9cthis\xe2\x80\x9d\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe7\x94\xa8\xe4\xba\x8e\xe9\x94\x81\xe5\xae\x9a.', 'role_desc_en': 'Locking on the current object instance (i.e. this), or on a Type object increases the chance of deadlocks because any other thread could acquire (or attempt to acquire) the same lock for another unrelated purpose. Instead, a new, private object should be created and used for the lock.', 'role_id': 'S2551', 'role_desc': '\xe9\x94\x81\xe5\xae\x9a\xe5\xbd\x93\xe5\x89\x8d\xe5\xaf\xb9\xe8\xb1\xa1\xe5\xae\x9e\xe4\xbe\x8b\xef\xbc\x88i.\xe8\xbf\x99\xe4\xb8\xaa\xef\xbc\x89\xe6\x88\x96\xe8\x80\x85\xe4\xb8\x80\xe4\xb8\xaaType\xe5\xaf\xb9\xe8\xb1\xa1\xe5\xa2\x9e\xe5\x8a\xa0\xe4\xba\x86\xe6\xad\xbb\xe9\x94\x81\xe7\x9a\x84\xe6\x9c\xba\xe4\xbc\x9a\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe4\xbb\xbb\xe4\xbd\x95\xe5\x85\xb6\xe4\xbb\x96\xe7\xba\xbf\xe7\xa8\x8b\xe5\x8f\xaf\xe4\xbb\xa5\xe8\x8e\xb7\xe5\xbe\x97\xef\xbc\x88\xe6\x88\x96\xe5\xb0\x9d\xe8\xaf\x95\xe8\x8e\xb7\xe5\x8f\x96\xef\xbc\x89\xe5\x8f\xa6\xe4\xb8\x80\xe4\xb8\xaa\xe4\xb8\x8d\xe7\x9b\xb8\xe5\x85\xb3\xe7\x9b\xae\xe7\x9a\x84\xe7\x9a\x84\xe9\x94\x81.\xe7\x9b\xb8\xe5\x8f\x8d\xef\xbc\x8c\xe5\xba\x94\xe8\xaf\xa5\xe5\x88\x9b\xe5\xbb\xba\xe4\xb8\x80\xe4\xb8\xaa\xe6\x96\xb0\xe7\x9a\x84\xe7\xa7\x81\xe6\x9c\x89\xe5\xaf\xb9\xe8\xb1\xa1\xe5\xb9\xb6\xe5\xb0\x86\xe5\x85\xb6\xe7\x94\xa8\xe4\xba\x8e\xe9\x94\x81\xe5\xae\x9a.', 'role_title_en': 'Types and "this" should not be used for locking'}

