', 'role_origin_id': 'rule_RSPEC-3902', 'role_have_compliant_code': 'Y', 'role_level': 'MAJOR', 'role_type': 'CodeSmell', 'role_title': '\xe2\x80\x9c\xe9\x83\xa8\xe4\xbb\xb6.GetExecutingAssembly\xe2\x80\x9c\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe8\xa2\xab\xe8\xb0\x83\xe7\x94\xa8.', 'role_desc_en': "Using Type.Assembly to get the current assembly is nearly free in terms of performance; it's a simple property access. On the other hand, Assembly.GetExecutingAssembly() can take up to 30 times as long because it walks up the call stack to find the assembly.", 'role_id': 'S3902', 'role_desc': '\xe4\xbd\xbf\xe7\x94\xa8\xe7\xb1\xbb\xe5\x9e\x8b.\xe8\x8e\xb7\xe5\xbe\x97\xe5\xbd\x93\xe5\x89\x8d\xe8\xa3\x85\xe9\x85\x8d\xe7\x9a\x84\xe8\xa3\x85\xe9\x85\x8d\xe5\x9c\xa8\xe6\x80\xa7\xe8\x83\xbd\xe6\x96\xb9\xe9\x9d\xa2\xe5\x87\xa0\xe4\xb9\x8e\xe6\x98\xaf\xe5\x85\x8d\xe8\xb4\xb9\xe7\x9a\x84;.\xe5\x8f\xa6\xe4\xb8\x80\xe6\x96\xb9\xe9\x9d\xa2\xef\xbc\x8c\xe5\xa4\xa7\xe4\xbc\x9a.GetExecutingAssembly\xef\xbc\x88\xef\xbc\x89\xe6\x9c\x80\xe5\xa4\x9a\xe5\x8f\xaf\xe8\x83\xbd\xe9\x9c\x80\xe8\xa6\x8130\xe6\xac\xa1\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe5\xae\x83\xe4\xbc\x9a\xe8\xb0\x83\xe7\x94\xa8\xe8\xb0\x83\xe7\x94\xa8\xe5\xa0\x86\xe6\xa0\x88\xe6\x9d\xa5\xe6\x9f\xa5\xe6\x89\xbe\xe7\xa8\x8b\xe5\xba\x8f\xe9\x9b\x86.', 'role_title_en': '"Assembly.GetExecutingAssembly" should not be called'}

