', 'role_origin_id': 'rule_RSPEC-1244', 'role_have_compliant_code': '', 'role_level': 'MAJOR', 'role_type': 'Bug', 'role_title': '\xe4\xb8\x8d\xe5\xba\x94\xe5\xaf\xb9\xe6\xb5\xae\xe7\x82\xb9\xe6\x95\xb0\xe8\xbf\x9b\xe8\xa1\x8c\xe7\x9b\xb8\xe7\xad\x89\xe6\xb5\x8b\xe8\xaf\x95.', 'role_desc_en': 'Floating point math is imprecise because of the challenges of storing such values in a binary representation. Even worse, floating point math is not associative; push a float or a double through a series of simple mathematical operations and the answer will be different based on the order of those operation because of the rounding that takes place at each step.Even simple floating point assignments are not simple:(Results will vary based on compiler and compiler settings)Therefore, the use of the equality (==) and inequality (!=) operators on float or double values is almost always an error.This rule checks for the use of direct and indirect equality/inequailty tests on floats and doubles.', 'role_id': 'S1244', 'role_desc': '\xe6\xb5\xae\xe7\x82\xb9\xe6\x95\xb0\xe5\xad\xa6\xe6\x98\xaf\xe4\xb8\x8d\xe7\xb2\xbe\xe7\xa1\xae\xe7\x9a\x84\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe5\x9c\xa8\xe4\xba\x8c\xe8\xbf\x9b\xe5\x88\xb6\xe8\xa1\xa8\xe7\xa4\xba\xe4\xb8\xad\xe5\xad\x98\xe5\x82\xa8\xe8\xbf\x99\xe4\xba\x9b\xe5\x80\xbc\xe7\x9a\x84\xe6\x8c\x91\xe6\x88\x98.\xe6\x9b\xb4\xe7\xb3\x9f\xe7\xb3\x95\xe7\x9a\x84\xe6\x98\xaf\xef\xbc\x8c\xe6\xb5\xae\xe7\x82\xb9\xe6\x95\xb0\xe5\xad\xa6\xe4\xb8\x8d\xe6\x98\xaf\xe8\x81\x94\xe6\x83\xb3\xe7\x9a\x84;.\xe5\x8d\xb3\xe4\xbd\xbf\xe7\xae\x80\xe5\x8d\x95\xe7\x9a\x84\xe6\xb5\xae\xe7\x82\xb9\xe5\x88\x86\xe9\x85\x8d\xe4\xb9\x9f\xe4\xb8\x8d\xe7\xae\x80\xe5\x8d\x95\xef\xbc\x9a.\xef\xbc\x88\xe7\xbb\x93\xe6\x9e\x9c\xe5\xb0\x86\xe6\xa0\xb9\xe6\x8d\xae\xe7\xbc\x96\xe8\xaf\x91\xe5\x99\xa8\xe5\x92\x8c\xe7\xbc\x96\xe8\xaf\x91\xe5\x99\xa8\xe8\xae\xbe\xe7\xbd\xae\xe8\x80\x8c\xe6\x9c\x89\xe6\x89\x80\xe4\xb8\x8d\xe5\x90\x8c\xef\xbc\x89.\xe5\x9b\xa0\xe6\xad\xa4\xef\xbc\x8c\xe5\