', 'role_origin_id': 'rule_RSPEC-3234', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'CodeSmell', 'role_title': '\xe2\x80\x9cGC.\xe5\xaf\xb9\xe4\xba\x8e\xe6\xb2\xa1\xe6\x9c\x89\xe6\x9e\x90\xe6\x9e\x84\xe5\x87\xbd\xe6\x95\xb0\xe7\x9a\x84\xe7\xb1\xbb\xe5\x9e\x8b\xef\xbc\x8c\xe4\xb8\x8d\xe5\xba\x94\xe8\xaf\xa5\xe8\xb0\x83\xe7\x94\xa8\xe2\x80\x9cSuppressFinalize\xe2\x80\x9d.', 'role_desc_en': "GC.SuppressFinalize asks the Common Language Runtime not to call the finalizer of an object. This is useful when implementing the dispose pattern where object finalization is already handled in IDisposable.Dispose. However, it has no effect if there is no finalizer defined in the object's type, so using it in such cases is just confusing.This rule raises an issue when GC.SuppressFinalize is called for objects of sealed types without a finalizer.*Note:* S3971 is a stricter version of this rule. Typically it makes sense to activate only one of these 2 rules.", 'role_id': 'S3234', 'role_desc': 'GC.SuppressFinalize\xe8\xa6\x81\xe6\xb1\x82\xe5\x85\xac\xe5\x85\xb1\xe8\xaf\xad\xe8\xa8\x80\xe8\xbf\x90\xe8\xa1\x8c\xe6\x97\xb6\xe4\xb8\x8d\xe8\xb0\x83\xe7\x94\xa8\xe5\xaf\xb9\xe8\xb1\xa1\xe7\x9a\x84\xe7\xbb\x88\xe7\xbb\x93\xe5\x99\xa8.\xe8\xbf\x99\xe5\x9c\xa8\xe5\xae\x9e\xe7\x8e\xb0\xe5\x9c\xa8IDisposable\xe4\xb8\xad\xe5\xb7\xb2\xe5\xa4\x84\xe7\x90\x86\xe5\xaf\xb9\xe8\xb1\xa1\xe7\xbb\x88\xe7\xbb\x93\xe7\x9a\x84\xe5\xa4\x84\xe7\x90\x86\xe6\xa8\xa1\xe5\xbc\x8f\xe6\x97\xb6\xe9\x9d\x9e\xe5\xb8\xb8\xe6\x9c\x89\xe7\x94\xa8.\xe9\x83\xa8\xe7\xbd\xb2.\xe4\xbd\x86\xe6\x98\xaf\xef\xbc\x8c\xe5\xa6\x82\xe6\x9e\x9c\xe6\xb2\xa1\xe6\x9c\x89\xe5\x9c\xa8\xe5\xaf\xb9\xe8\xb1\xa1\xe7\x9a\x84\xe7\xb1\xbb\xe5\x9e\x8b\xe4\xb8\xad\xe5\xae\x9a\xe4\xb9\x89finalizer\xef\xbc\x8c\xe9\x82\xa3\xe4\xb9\x88\xe5\xae\x83\xe5\xb0\xb1\xe6\xb2\xa1\xe6\x9c\x89\xe4\xbb\xbb\xe4\xbd\x95\xe6\x95\x88\xe6\x9e\x9c\xef\xbc\x8c\xe6\x89\x80\xe4\xbb\xa5\xe5\x9c\xa8\xe8\xbf\x99\xe7\xa7\x8d\xe6\x83\x85\xe5\x86\xb5\xe4\x