', 'role_origin_id': 'rule_RSPEC-1698', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'CodeSmell', 'role_title': '\xe5\xbd\x93\xe2\x80\x9c\xe7\xad\x89\xe4\xba\x8e\xe2\x80\x9d\xe8\xa2\xab\xe8\xa6\x86\xe7\x9b\x96\xe6\x97\xb6\xef\xbc\x8c\xe4\xb8\x8d\xe5\xba\x94\xe4\xbd\xbf\xe7\x94\xa8\xe2\x80\x9c==\xe2\x80\x9d.', 'role_desc_en': 'Using the equality == and inequality != operators to compare two objects generally works. The operators can be overloaded, and therefore the comparison can resolve to the appropriate method. However, when the operators are used on interface instances, then == resolves to reference equality, which may result in unexpected behavior if implementing classes override Equals. Similarly, when a class overrides Equals, but instances are compared with non-overloaded ==, there is a high chance that value comparison was meant instead of the reference one.', 'role_id': 'S1698', 'role_desc': '\xe4\xbd\xbf\xe7\x94\xa8\xe7\xad\x89\xe4\xba\x8e==\xe5\x92\x8c\xe4\xb8\x8d\xe7\xad\x89\xe5\xbc\x8f\xef\xbc\x81=\xe8\xbf\x90\xe7\xae\x97\xe7\xac\xa6\xe6\xaf\x94\xe8\xbe\x83\xe4\xb8\xa4\xe4\xb8\xaa\xe5\xaf\xb9\xe8\xb1\xa1\xe9\x80\x9a\xe5\xb8\xb8\xe6\x9c\x89\xe6\x95\x88.\xe6\x93\x8d\xe4\xbd\x9c\xe5\x91\x98\xe5\x8f\xaf\xe4\xbb\xa5\xe8\xbf\x87\xe8\xbd\xbd\xef\xbc\x8c\xe5\x9b\xa0\xe6\xad\xa4\xe6\xaf\x94\xe8\xbe\x83\xe5\x8f\xaf\xe4\xbb\xa5\xe8\xa7\xa3\xe5\x86\xb3\xe9\x80\x82\xe5\xbd\x93\xe7\x9a\x84\xe6\x96\xb9\xe6\xb3\x95.\xe4\xbd\x86\xe6\x98\xaf\xef\xbc\x8c\xe5\xbd\x93\xe6\x8e\xa5\xe5\x8f\xa3\xe5\xae\x9e\xe4\xbe\x8b\xe4\xbd\xbf\xe7\x94\xa8\xe8\xbf\x90\xe7\xae\x97\xe7\xac\xa6\xe6\x97\xb6\xef\xbc\x8c==\xe8\xa7\xa3\xe6\x9e\x90\xe4\xb8\xba\xe5\xbc\x95\xe7\x94\xa8\xe7\x9b\xb8\xe7\xad\x89\xe6\x80\xa7\xef\xbc\x8c\xe5\xa6\x82\xe6\x9e\x9c\xe5\xae\x9e\xe7\x8e\xb0\xe7\xb1\xbb\xe8\xa6\x86\xe7\x9b\x96\xe7\xad\x89\xe4\xba\x8e.\xe7\xb1\xbb\xe4\xbc\xbc\xe5\x9c\xb0\xef\xbc\x8c\xe5\xbd\x93\xe4\xb8\x80\xe4\xb8\xaa\xe7\xb1\xbb\xe8\xa6\x86\xe7\x9b\x96Equals\xef\xbc\x8c\xe4\xbd\x86\xe6\x98\xaf\xe5\xae\x9e\xe4\xbe\x8b\xe4\xb8\x8e\xe9\x9d\x9e\xe9\x87\x8d\xe8\xbd\xbd\xe7\x9a\x84==\xe6\xaf\x94\xe8\xbe\x83\xe6\x97\xb6\xef\xbc\x8c\xe6\x9c\x89\xe5\xbe\x88\xe5\xa4\xa7\xe7\x9a\x84\xe5\x8f\xaf\xe8\x83\xbd\xe6\x80\xa7\xef\xbc\x8c\xe8\x80\x8c\xe4\xb8\x8d\xe6\x98\xaf\xe5\x8f\x82\xe8\x80\x83\xe5\x80\xbc.', 'role_title_en': '"==" should not be used when "Equals" is overridden'}

