}

', 'role_origin_id': 'rule_RSPEC-1226', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'CodeSmell', 'role_title': '\xe6\x96\xb9\xe6\xb3\x95\xe5\x8f\x82\xe6\x95\xb0\xe5\x92\x8c\xe6\x8d\x95\xe8\x8e\xb7\xe7\x9a\x84\xe5\xbc\x82\xe5\xb8\xb8\xe4\xb8\x8d\xe5\xba\x94\xe9\x87\x8d\xe6\x96\xb0\xe5\x88\x86\xe9\x85\x8d.', 'role_desc_en': 'While it is technically correct to assign to parameters from within method bodies, it is better to use temporary variables to store intermediate results.
This rule will typically detect cases where a constructor parameter is assigned to itself instead of a field of the same name, i.e. when this was forgotten.
Allowing parameters to be assigned to also reduces the code readability as developers will not be able to know whether the original parameter or some temporary variable is being accessed without going through the whole method.
Moreover, some developers might also expect assignments of method parameters to be visible from callers, which is not the case and can confuse them.
All parameters should be treated as readonly.', 'role_id': 'S1226', 'role_desc': '\xe4\xbb\x8e\xe6\x96\xb9\xe6\xb3\x95\xe4\xbd\x93\xe5\x86\x85\xe5\x88\x86\xe9\x85\x8d\xe5\x8f\x82\xe6\x95\xb0\xe5\x9c\xa8\xe6\x8a\x80\xe6\x9c\xaf\xe4\xb8\x8a\xe6\x98\xaf\xe6\xad\xa3\xe7\xa1\xae\xe7\x9a\x84\xef\xbc\x8c\xe6\x9c\x80\xe5\xa5\xbd\xe4\xbd\xbf\xe7\x94\xa8\xe4\xb8\xb4\xe6\x97\xb6\xe5\x8f\x98\xe9\x87\x8f\xe6\x9d\xa5\xe5\xad\x98\xe5\x82\xa8\xe4\xb8\xad\xe9\x97\xb4\xe7\xbb\x93\xe6\x9e\x9c.\xe8\xaf\xa5\xe8\xa7\x84\xe5\x88\x99\xe9\x80\x9a\xe5\xb8\xb8\xe4\xbc\x9a\xe6\xa3\x80\xe6\xb5\x8b\xe5\x88\xb0\xe6\x9e\x84\xe9\x80\xa0\xe5\x87\xbd\xe6\x95\xb0\xe5\x8f\x82\xe6\x95\xb0\xe5\x88\x86\xe9\x85\x8d\xe7\xbb\x99\xe8\x87\xaa\xe8\xba\xab\xe8\x80\x8c\xe4\xb8\x8d\xe6\x98\xaf\xe5\x90\x8c\xe5\x90\x8d\xe7\x9a\x84\xe5\xad\x97\xe6\xae\xb5\xe7\x9a\x84\xe6\x83\x85\xe5\x86\xb5\xef\xbc\x8ci.\xe5\xbd\x93\xe8\xbf\x99\xe8\xa2\xab\xe9\x81\x97\xe5\xbf\x98\xe7\x9a\x84\xe6\x97\xb6\xe5\x80\x99.\xe5\x85\x81\xe8\xae\xb8\xe5\x88\x86\xe9\x85\x8d\xe5\x8f\x82\xe6\x95\xb0\xe8\xbf\x98\xe5\x8f\xaf\xe4\xbb\xa5\xe9\x99\x8d\xe4\xbd\x8e\xe4\xbb\xa3\xe7\xa0\x81\xe5\x8f\xaf\xe8\xaf\xbb\xe6\x80\xa7\xef\xbc\x8c\xe5\x9b\xa0\xe4\xb8\xba\xe5\xbc\x80\xe5\x8f\x91\xe4\xba\xba\xe5\x91\x98\xe5\xb0\x86\xe6\x97\xa0\xe6\xb3\x95\xe7\x9f\xa5\xe9\x81\x93\xe6\x98\xaf\xe5\x90\xa6\xe6\xad\xa3\xe5\x9c\xa8\xe8\xae\xbf\xe9\x97\xae\xe5\x8e\x9f\xe5\xa7\x8b\xe5\x8f\x82\xe6\x95\xb0\xe6\x88\x96\xe6\x9f\x90\xe4\xb8\xaa\xe4\xb8\xb4\xe6\x97\xb6\xe5\x8f\x98\xe9\x87\x8f\xef\xbc\x8c\xe8\x80\x8c\xe6\x97\xa0\xe9\x9c\x80\xe9\x80\x9a\xe8\xbf\x87\xe6\x95\xb4\xe4\xb8\xaa\xe6\x96\xb9\xe6\xb3\x95.\xe6\xad\xa4\xe5\xa4\x96\xef\xbc\x8c\xe4\xb8\x80\xe4\xba\x9b\xe5\xbc\x80\xe5\x8f\x91\xe4\xba\xba\xe5\x91\x98\xe8\xbf\x98\xe5\x8f\xaf\xe8\x83\xbd\xe6\x9c\x9f\xe6\x9c\x9b\xe6\x96\xb9\xe6\xb3\x95\xe5\x8f\x82\xe6\x95\xb0\xe7\x9a\x84\xe5\x88\x86\xe9\x85\x8d\xe4\xbb\x8e\xe8\xb0\x83\xe7\x94\xa8\xe8\x80\x85\xe5\x8f\xaf\xe8\xa7\x81\xef\xbc\x8c\xe4\xbd\x86\xe6\x83\x85\xe5\x86\xb5\xe5\