', 'role_origin_id': 'rule_RSPEC-2674', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'Bug', 'role_title': '\xe5\xba\x94\xe8\xaf\xa5\xe6\xa3\x80\xe6\x9f\xa5\xe4\xbb\x8e\xe6\xb5\x81\xe8\xaf\xbb\xe5\x8f\x96\xe8\xbf\x94\xe5\x9b\x9e\xe7\x9a\x84\xe9\x95\xbf\xe5\xba\xa6.', 'role_desc_en': 'You cannot assume that any given stream reading call will fill the byte[] passed in to the method with the number of bytes requested. Instead, you must check the value returned by the read method to see how many bytes were read. Fail to do so, and you introduce a bug that is both harmful and difficult to reproduce.This rule raises an issue when a Stream.Read or a Stream.ReadAsync method is called, but the return value is not checked.', 'role_id': 'S2674', 'role_desc': '\xe6\x82\xa8\xe4\xb8\x8d\xe8\x83\xbd\xe5\x81\x87\xe5\xae\x9a\xe4\xbb\xbb\xe4\xbd\x95\xe7\xbb\x99\xe5\xae\x9a\xe7\x9a\x84\xe6\xb5\x81\xe8\xaf\xbb\xe5\x8f\x96\xe8\xb0\x83\xe7\x94\xa8\xe5\xb0\x86\xe5\xa1\xab\xe5\x85\x85\xe4\xbc\xa0\xe9\x80\x92\xe7\xbb\x99\xe6\x96\xb9\xe6\xb3\x95\xe7\x9a\x84\xe5\xad\x97\xe8\x8a\x82[]\xef\xbc\x8c\xe8\xaf\xb7\xe6\xb1\x82\xe7\x9a\x84\xe5\xad\x97\xe8\x8a\x82\xe6\x95\xb0.\xe7\x9b\xb8\xe5\x8f\x8d\xef\xbc\x8c\xe6\x82\xa8\xe5\xbf\x85\xe9\xa1\xbb\xe6\xa3\x80\xe6\x9f\xa5\xe8\xaf\xbb\xe5\x8f\x96\xe6\x96\xb9\xe6\xb3\x95\xe8\xbf\x94\xe5\x9b\x9e\xe7\x9a\x84\xe5\x80\xbc\xe4\xbb\xa5\xe6\x9f\xa5\xe7\x9c\x8b\xe8\xaf\xbb\xe5\x8f\x96\xe7\x9a\x84\xe5\xad\x97\xe8\x8a\x82\xe6\x95\xb0.\xe6\xb2\xa1\xe6\x9c\x89\xe8\xbf\x99\xe6\xa0\xb7\xe5\x81\x9a\xef\xbc\x8c\xe4\xbd\xa0\xe4\xbc\x9a\xe5\xbc\x95\xe5\x85\xa5\xe4\xb8\x80\xe4\xb8\xaa\xe6\x97\xa2\xe6\x9c\x89\xe5\xae\xb3\xe5\x8f\x88\xe9\x9a\xbe\xe4\xbb\xa5\xe5\xa4\x8d\xe5\x88\xb6\xe7\x9a\x84\xe9\x94\x99\xe8\xaf\xaf.\xe8\xbf\x99\xe4\xb8\xaa\xe8\xa7\x84\xe5\x88\x99\xe5\xbc\x95\xe8\xb5\xb7\xe4\xba\x86\xe4\xb8\x80\xe4\xb8\xaaStream\xe7\x9a\x84\xe9\x97\xae\xe9\xa2\x98.\xe8\xaf\xbb\xe6\x88\x96\xe6\xb5\x81.\xe8\xb0\x83\xe7\x94\xa8ReadAsync\xe6\x96\xb9\xe6\xb3