', 'role_origin_id': 'rule_RSPEC-1449', 'role_have_compliant_code': 'Y', 'role_level': 'MINOR', 'role_type': 'Bug', 'role_title': '\xe5\xba\x94\xe4\xb8\xba\xe2\x80\x9c\xe5\xad\x97\xe7\xac\xa6\xe4\xb8\xb2\xe2\x80\x9d\xe6\x93\x8d\xe4\xbd\x9c\xe6\x8c\x87\xe5\xae\x9a\xe6\x96\x87\xe5\x8c\x96.', 'role_desc_en': 'string.ToLower(), ToUpper, IndexOf, LastIndexOf, and Compare are all culture-dependent, as are some (floating point number and DateTime-related) calls to ToString. Fortunately, all have variants which accept an argument specifying the culture or formatter to use. Leave that argument off and the call will use the system default culture, possibly creating problems with international characters.string.CompareTo() is also culture specific, but has no overload that takes a culture information, so instead it's better to use CompareOrdinal, or Compare with culture.Calls without a culture may work fine in the system's "home" environment, but break in ways that are extremely difficult to diagnose for customers who use different encodings. Such bugs can be nearly, if not completely, impossible to reproduce when it's time to fix them.', 'role_id': 'S1449', 'role_desc': '\xe4\xb8\xb2.ToLower\xef\xbc\x88\xef\xbc\x89\xef\xbc\x8cToUpper\xef\xbc\x8cIndexOf\xef\xbc\x8cLastIndexOf\xe5\x92\x8cCompare\xe9\x83\xbd\xe6\x98\xaf\xe6\x96\x87\xe5\x8c\x96\xe4\xbe\x9d\xe8\xb5\x96\xe7\x9a\x84\xef\xbc\x8cToString\xe7\x9a\x84\xe4\xb8\x80\xe4\xba\x9b\xef\xbc\x88\xe6\xb5\xae\xe7\x82\xb9\xe6\x95\xb0\xe5\x92\x8cDateTime\xe7\x9b\xb8\xe5\x85\xb3\xef\xbc\x89\xe8\xb0\x83\xe7\x94\xa8.\xe5\xb9\xb8\xe8\xbf\x90\xe7\x9a\x84\xe6\x98\xaf\xef\xbc\x8c\xe6\x89\x80\xe6\x9c\x89\xe7\x9a\x84\xe5\x8f\x98\xe4\xbd\x93\xe9\x83\xbd\xe6\x8e\xa5\xe5\x8f\x97\xe4\xb8\x80\xe4\xb8\xaa\xe5\x8f\x82\xe6\x95\xb0\xef\xbc\x8c\xe6\x8c\x87\xe5\xae\x9a\xe8\xa6\x81\xe4\xbd\xbf\xe7\x94\xa8\xe7\x9a\x84\xe6\x96\x87\xe5\x8c\x96\xe6\x88\x96\xe6\xa0\xbc\xe5\xbc\x8f\xe5\x8c\x96\xe5\x99\xa8.\xe7\xa6\xbb\xe5\xbc\x80\xe8\xaf\xa5\xe5\x8f\x82\xe6\x